import { Button } from '@material-ui/core'
import React from 'react'
import { Data } from './Data'
import { Container } from './style'
function Card() {
    return (
        <div>
            {Data.map((data) => (
                <Container>
                    <h1>{data.title}</h1>
                    <Button>Shop Now</Button>
                </Container>
            ))}
        </div>
    )
}

export default Card
